import React from 'react';
import {Link} from 'react-router-dom';
import Island from './Island';

const Islands = (props) => {
  console.log(props)
  const list = props.islands.map(island => 
    <div key={island.id}>
      <Link to={`/islands/${island.id}`}>{island.name}</Link>
    </div>
    )
  return (
    <div>
      <h2>Islands</h2>
      {list}
    </div>
  )
}

export default Islands;
